    width: 375px;
    height: 100px;
    margin: auto;
    display: flex;
    flex-direction: column;
    justify-content: space-around;
    align-items: center;
  `;

  const Span = styled.span`
    margin-left: 20px;
  `;


  return(
    <Section>
      <Span>se repite el:</Span>
    </Section>
  )
}

export default RepeatOn
